import styled from "styled-components";
import { useDispatch, useSelector } from "react-redux";
import { useEffect } from "react";
import { useHistory } from "react-router";
import { useTranslation } from "react-i18next";
import { unwrapResult } from "@reduxjs/toolkit";

import { ComponentHeaderAuth } from "@components";
import { selectMerchant } from "@redux";
import { ModuleTel } from "@modules";

export const PageSignUpTelFrom = () => {
    //page variable
    const merchant = useSelector(selectMerchant);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleTel />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
